        for (i = 0; i < nbra; i++) {
                gsph[0*nbra+i] = gcart[1*nbra+i];  // py
                gsph[1*nbra+i] = gcart[2*nbra+i];  // pz
                gsph[2*nbra+i] = gcart[0*nbra+i];  // px
        }
        return gsph;
